import logo from "./logo.svg";
import "./App.css";
import Todo from "./components/Todo";

function App() {
  return (
    <div>
      <h1>Todo</h1>
      <input type="text"></input>
      <button class="btn">Submit</button>
      <Todo text="Learn React" />
      <Todo text="Master React" />
      <Todo text="Explore React" />
    </div>
  );
}

export default App;
